"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.mapDispatchToProps=exports.mapStateToProps=exports.reducer=void 0;var e=Object.assign||function(e){for(var t=1;t<arguments.length;t++){var r=arguments[t];for(var n in r)Object.prototype.hasOwnProperty.call(r,n)&&(e[n]=r[n])}return e},t=require("react"),r=f(t),n=require("prop-types"),o=f(n),a=require("react-redux");require("./style.scss");var u=require("react-waypoint"),c=f(u),i=require("/components/Text"),p=f(i),l=require("/components/ExplodedMap"),s=f(l),d=require("/components/ExplorerBar");function f(e){return e&&e.__esModule?e:{default:e}}var v="OPEN_BOX",E=exports.reducer=function(){var t=arguments.length>0&&void 0!==arguments[0]?arguments[0]:{};switch((arguments.length>1&&void 0!==arguments[1]?arguments[1]:{}).type){case v:return e({},t,{isOpen:!0});default:return t}},m=function(e){var t=e.isOpen,n=e.clickOpen,o=e.onEnterSection,a=e.onLeaveSection;return r.default.createElement("div",{className:"GuideMenu"},r.default.createElement(c.default,{onEnter:o,onLeave:a}),t?r.default.createElement(s.default,null):r.default.createElement("div",{className:"closedBox"},r.default.createElement("a",{onClick:n},r.default.createElement(p.default,{id:"assembly.open"}))))};m.propTypes={isOpen:o.default.bool,clickOpen:o.default.func,onEnterSection:o.default.func,onLeaveSection:o.default.func};var O=exports.mapStateToProps=function(e){return e.guideBox},x=exports.mapDispatchToProps=function(e){return{clickOpen:function(){return e({type:v})},onEnterSection:function(){return e({type:d.SHOW_EXPLORER_BAR})},onLeaveSection:function(){return e({type:d.HIDE_EXPLORER_BAR})}}};exports.default=(0,a.connect)(O,x)(m);
