"use strict";Object.defineProperty(exports,"__esModule",{value:!0});var e=require("fs"),a=n(e);function n(e){return e&&e.__esModule?e:{default:e}}exports.default={steps:["intro","modes","box","panel","electronics","back","left","right","front"],content:{intro:{es:"Este proyecto empezó ...\n",en:"# intro english\n"},modes:{es:'\nLas aberturas de los lados de la caja y las partes 3D están pensadas para que puedan\nser combinadas según el uso que se le va a dar.  \n\nArmé algunas combinaciones comunes con un propósito determinado que explico abajo, pero \nse pueden crear otras combinaciones también.\n\nPara visualizar cada modo en 3D ingresar al Personalizador: http://customizer.openarcade.com.ar\n\n### RetroPie Full\nLa versión mas completa, cuenta con todas las características del proyecto.\n* RaspberryPi con RetroPie para enchufar a la TV y jugar\n* Un selector USB para pasar a modo "joystick solo" y utilizarlo en una PC\n* Botones Cheat (en caso de que lo soporte la interfaz USB del joystick)\n* USB Rack para conectar otros joysticks, teclado o mouse, etc.\n\n### RetroPie Cheater\nIgual que la versión Full pero sin el selector USB para el modo "joystick solo". Esta versión no está pensada para ser usada en una PC.\n* RaspberryPi con RetroPie para enchufar a la TV y jugar\n* Botones Cheat (en caso de que lo soporte la interfaz USB del joystick)\n* USB Rack para conectar otros joysticks, teclado o mouse, etc.\n\n### RetroPie\nVersión sin los botones Cheat en caso de que la interfaz usb usada no lo soporte, simplemente se reemplaza con una pieza 3D de ventilación para la raspberry pi.\n* RaspberryPi con RetroPie para enchufar a la TV y jugar\n* USB Rack para conectar otros joysticks, teclado o mouse, etc.\n\n### RetroPie Solo\nLa Versión mas simple con RaspberryPi. No posee el rack USB ni el selector. Está pensada para simplificar la construcción pero mantener la simplicidad de enchufar a una TV y jugar.\n* RaspberryPi con RetroPie para enchufar a la TV y jugar\n\n### Joystick Cheater\nEl modo Joystick con botones Cheat. Simplemente un joystick arcade con una salida USB para conectar a una PC y jugar.\nEn caso de que la interfaz USB no soporte los botones Cheat ver la siguiente versión (Joystick).\n* Botones Cheat (en caso de que lo soporte la interfaz USB del joystick)\n* Salida USB posterior\n\n### Joystick\nLa versión mas simple del proyecto, un joystick arcade con una salida USB para conectar a una PC y jugar.\n* Salida USB posterior\n',en:'\nThe box and its openings have dimensions to have interchangeable 3D printed parts. Although you can customize your own I have set some predefined modes below as a starting point.\n\nUsing the 3D customizer you can have a better understaning of each mode and how it looks at http://customizer.openarcade.com.ar\n\n### RetroPie Full\nThe complete version. It has all the features of this project in it.\n* RaspberryPi with RetroPie just plug & play on your TV\n* USB Selector to switch between a "joystick solo" mode and use it plugged into a PC\n* Cheat Buttons (if the joystick USB interface supports it)\n* USB Rack for plugging in other devices like a joystick, keyboard and mouse, etc.\n\n### RetroPie Cheater\nSame as Full version but without a USB Selector for the "joystick solo" mode. This version is not meant to be used with a PC.\n* RaspberryPi with RetroPie just plug & play on your TV\n* Cheat Buttons (if the joystick USB interface supports it)\n* USB Rack for plugging in other devices like a joystick, keyboard and mouse, etc.\n\n### RetroPie\nA version without Cheat Buttons for those USB Interface which does not support them. This is done by replacing a 3D pieze with a ventilation one for the raspberry pi.\n* RaspberryPi with RetroPie just plug & play on your TV\n* USB Rack for plugging in other devices like a joystick, keyboard and mouse, etc.\n\n### RetroPie Solo\nThe simplest version with a RaspberryPi. It has no USB Rack or USB Selector. It is meant to simplify the build and keeping the simple plug&play within a TV.\n* RaspberryPi with RetroPie just plug & play on your TV\n\n### Joystick Cheater\nJoystick mode with Cheat Buttoms. Just an arcade joystick with a USB output to play on a PC. \n* Cheat Buttons (if the joystick USB interface supports it)\n* External USB output\n\n### Joystick\nSimpliest version of this project. Just an Arcade Joystick with a USB output to play on a PC.  \n* External USB output\n'},box:{es:'[mdf]: /guide/box/mdf.jpg\n[parts]: /guide/box/parts.jpg\n\n[template1]: /guide/box/template1.jpg\n[template2]: /guide/box/template2.jpg\n[template3]: /guide/box/template3.jpg\n[template4]: /guide/box/template4.jpg\n\n[squarecuts]: /guide/box/squarecuts.jpg\n[frontholes]: /guide/box/front_holes.jpg\n[vinil]: /guide/box/vinil.jpg\n\n[sideslegs]: /guide/box/sideslegs.jpg\n[sideslegs1]: /guide/box/sideslegs1.jpg\n\n[frontbacklegs]: /guide/box/frontbacklegs.jpg\n[frontbacklegs1]: /guide/box/frontbacklegs1.jpg\n[frontbacklegs2]: /guide/box/frontbacklegs2.jpg\n[frontbacklegs3]: /guide/box/frontbacklegs3.jpg\n\n[baselegs]: /guide/box/baselegs.jpg\n[baselegs1]: /guide/box/baselegs1.jpg\n[baselegs2]: /guide/box/baselegs2.jpg\n\n[els]: /guide/box/els.jpg\n[els1]: /guide/box/els1.jpg\n[els2]: /guide/box/els2.jpg\n[elsdone]: /guide/box/elsdone.jpg\n[elsdone1]: /guide/box/elsdone1.jpg\n[finishedbox]: /guide/box/finishedbox.jpg\n\n[front_back]: /guide/box/front_back.pdf\n[left_right]: /guide/box/left_right.pdf\n[base]: /guide/box/base.pdf\n\n[leg]: /guide/box/leg.stl\n[top_holder_L]: /guide/box/top_holder_L.stl\n\nPor defecto el tamaño de la caja es 200 (largo) x 160 (ancho) x 70 (alto) milímetros sin patas.\n\nEstá pensado para el uso de Acrílico de 6 mm o MDF de 5.5 mm de espesor.\n\nLos tamaños se pueden modificar sin problemas pero recomiendo mantener el espesor del material por las Patas y los diagramas.\n\nEl Largo de 200 mm funciona muy bien para los 6 botones de 24 mm pero en caso de querer usar botones de 30 mm habría que aumentar el largo de la caja y cambiar el diseño del panel. No me concentré en trabajar en eso todavía pero si existe la necesidad puedo ayudar a crear los diagramas.\n\nTomando como referencia ese tamaño de joystick dejo unos PDF para utilizar como plantillas en los cuales están todos los agujeros y cortes a realizar. \n\nCada plantilla tiene todas sus posibilidades asi que cuidado al marcar donde cortar y agujerear según la pieza que vamos a usar.\n\n### Materiales  \n\n![MDF][mdf]\n\n#### MDF 5.5 mm o Acrílico 6 mm\n* 2 de 200 x 70 mm (frente y dorso)\n* 2 de 160 x 70 mm (laterales)\n* 1 de 200 x 160 mm (base)\n\n![Partes][parts]\n\n#### Partes Impresas en 3D:\n* 4 x Patas [leg.stl][leg]\n* 4 x Eles superiores [top_holder_L.stl][top_holder_L]\n\nAdemás son necesarias 4 patas de goma de no mas de 21 mm de diámetro\n\n#### Tornillería:\n* 16 Tornillos 5/32" x 12 mm\n* 4 Tornillos 5/32" x 16 mm\n* 20 Tuercas __Estampadas__ 5/32" \n* 12 Arandelas Elástica Growler 5/32"\n\n### Herramientas:\n* Taladro\n  * Broca de 5 mm\n  * Broca grande de 8 mm o mas para realizar el paso de la caladora\n* Caladora (puede ser manual o eléctrica)\n  * Sierra para madera (evitar corte rápido)\n* Destornillador\n* Pinza de punta fina (para sostener las tuercas)\n\n------\n\n### Plantillas \n\nImprimir los archivos:\n* [front_back.pdf][front_back]\n* [left_right.pdf][left_right]\n* [base.pdf][base]\n\n![Plantilla 1][template1]\n\nAsegurarse de imprimir sin zoom o margenes, para comprobarlo medir los rectángulos impresos, tienen el tamaño exacto de cada pieza.\n\n![Plantilla 2][template2]\n\nCortar cada plantilla con una tijera, cutter o una guillotina de papel para tener las medidas exactas y tenerlos separados.\n\n![Plantilla 3][template3]\n\nLuego pegar con cinta de papel o algún otro pegamento simple de sacar y hacer las marcas donde vamos a agujerear y cortar.\n\n![Plantilla 4][template4]\n\nRealizar los agujeros de 5 mm en todos los círculos de union. Son 4 por pieza mas los necesarios para la pieza 3D a utilizar.\n\n> __Para la base realizar sólo los 4 agujeros exteriores para las patas.__ La plantilla tiene otros marcados que son para la electronica y es importante saber que se va a usar antes de hacerlos ya que pueden variar. Consultar la guía *Electrónica* para eso.\n\n![Cortes][squarecuts]\n\nRealizar los agujeros grandes para ingresar con la caladora y hacer los cortes rectangulares. No es necesario que queden perfectos ya que la pieza impresa en 3D va a ocultar el corte.\n\n> Para los cortes de calado revisar cada sección individualmente (laterales, dorso, etc) en cada paso referido a la pieza a utilizar (ej: ventilación, usb rack, raspberry pi, etc) para realizar los cortes que necesita la pieza correctamente.\n\nTodos los cortes rectangulares tienen un standard de 30 mm de alto por 30, 90 o 120 mm dependiendo de la pieza a utilizar.\n\n### Frente \n\n![Agujero frontales][frontholes]\n\nPara el frente las medidas de los agujeros y su disposición son opcionales y van a depender de que botones se utilicen. En mi caso el botón de encendido tiene un paso de 16 mm y los de START y SELECT son de 12 mm. La disposición de los agujeros es opcional, se puede variar sin mucho riesgo al armado de la caja.\n\n### Colores \n\n![Vinilo][vinil]\n\nEn caso de MDF se puede pintar, diseñar algo e imprimirlo con papel fotográfico adhesivo o bien cubrir con vinilo adhesivo.\n\n---\n\n### Patas \n\n![Laterales][sideslegs]\n\nPara armar la caja primero se unen los laterales con las patas, 2 por cada una\n\n![Laterales 1][sideslegs1]\n\nPasar 1 tornillo desde afuera hacia adentro luego agregar la arandela elástica en el lado de adentro y una tuerca. Dejarlo flojo, sin apretar por ahora. El lateral llega a tocar con ambos bordes de la pata.\n\n![Legs][frontbacklegs]\nUna vez que tenemos los 2 laterales, presentamos la base (sin atornillar)\n\n![Legs 1][frontbacklegs1]\n![Legs 2][frontbacklegs2]\n![Legs 3][frontbacklegs3]\n\nAgregamos el frente y luego el dorso de la misma manera que los laterales.\n\n![Base Legs][baselegs]\nAhora agregamos las 4 patas de goma, con sus respectivos tornillos pasantes (5/32" de 16 mm) desde afuera de la caja de la misma manera que los pasos anteriores.\n\n![Base Legs 1][baselegs1]\n![Base Legs 2][baselegs2]\n\nNos podemos ayudar con una pinza de punta fina para las tuercas que son difíciles de llegar pero todavía no ajustamos los tornillos.\n\n### Eles Superiores \n\n![Els][els]\nLuego armamos las Eles.\n\n![Els1][els1]\n![Els2][els2]\nInsertar 2 tuercas en cada una.\n\n![Elsdone1][elsdone1]\n\nPresentarlas y agregar los tornillos desde afuera, son 2 por esquina, tampoco debemos ajustarlos. \n\n![Elsdone][elsdone]\n\nDejar las aberturas de las tuercas hacia arriba de esta forma no se caen en la caja al instalar.\n\n![Armado terminado][finishedbox]\n\nUna vez que tenemos la caja presentada podemos ajustar todos los tornillos, los agujeros tienen 1 mm mas de diámetro aproximado, esto es para poder tener un juego y ajustar irregularidades que podamos tener en la caja, a medida que vamos ajustando los tornillos podemos ir sosteniendo las uniones para que queden alienadas.\n',en:"# BOX\n"},panel:{es:'[parts]: /guide/panel/parts.jpg\n\n[template1]: /guide/panel/template1.jpg\n[template2]: /guide/panel/template2.jpg\n[template3]: /guide/panel/template3.jpg\n\n[countersink]: /guide/panel/countersink.jpg \n[countersink1]: /guide/panel/countersink1.jpg\n[countersink2]: /guide/panel/countersink2.jpg\n[countersink3]: /guide/panel/countersink3.jpg\n\n[build1]: /guide/panel/build1.jpg \n[build2]: /guide/panel/build2.jpg \n[build3]: /guide/panel/build3.jpg \n[build4]: /guide/panel/build4.jpg \n[build5]: /guide/panel/build5.jpg \n\n[attach1]: /guide/panel/attach1.jpg \n[attach2]: /guide/panel/attach2.jpg \n[attach3]: /guide/panel/attach3.jpg \n[attach4]: /guide/panel/attach4.jpg \n[attach5]: /guide/panel/attach5.jpg \n[attach6]: /guide/panel/attach6.jpg \n\n[6_of_24_DG]: /guide/panel/6_of_24_DG.pdf\n[6_of_24_EG]: /guide/panel/6_of_24_EG.pdf\n[6_of_24_ST]: /guide/panel/6_of_24_ST.pdf\n\nDejo 3 plantillas con distintos diseños, se pueden ver como quedan en el Personalizador: http://customizer.openarcade.com.ar\n\n#### Plantillas \n* [6 botones de 24mm - Ergonómico][6_of_24_EG] \n* [6 botones de 24mm - Inclinado][6_of_24_DG]\n* [6 botones de 24mm - Derecho][6_of_24_ST]\n\n### Materiales  \n\n![Partes][parts]\n\n* Pieza de MDF 5.5mm (o Acrílico de 6 mm) de 200 x 160 mm\n* Acrílico cristal (o transparente) de 3 mm espesor por 200 x 160 mm\n* Palanca de Arcade\n* 6 botones arcade de 24 mm de diámetro\n\n#### Tornillería:\n\n* 8 Tornillos __Cabeza Plana__ 5/32" x 20 mm\n* 8 Tuercas __Estampadas__ 5/32" \n* 4 Arandelas Elástica Growler 5/32"\n* 4 Arandelas Planas 5/32"\n\n### Herramientas:\n\n* Taladro\n  * Broca de 5 mm (de acero rápido para el acrílico)\n  * Broca (*) de 25 mm para el paso de los botones\n  * Broca (\\*)(**) de 20 mm para el paso de la palanca\n  * Avellanadora de 12 mm\n* Destornillador\n\n(*) Se puede usar broca Plana, Forstner o Sierra Copa es realmente indistinto pero hay que tener cuidado con el acrílico para q no se rompa al hacer fuerza.\n\n(**) El diámetro de la broca depende del tipo de palanca, algunas tienen mas movimiento que otras y necesitan un diámetro mas grande. \n\n------\n\n### Taladro\n\nComenzar por cortar la plantilla por el cuadro exterior para alinearla a la pieza a agujerear y cortar.\n\n![Plantilla 1][template1]\n![Plantilla 2][template2]\n\nPegar la plantilla con cinta de papel a la pieza, recomiendo usar cinta de papel para poder repetir el proceso en el acrílico sin arruinar la plantilla. (También se pueden imprimir 2 plantillas)\n\n![Plantilla 3][template3]\n\nRealizar la marca de los puntos con un punzón, son 8 agujeros de 5 mm, uno central para la palanca y los 6 de los botones.\n\n> En algunas plantillas hay 2 puntos mas para poner los botones frontales (START y SELECT) en el panel. Antes de realizar esos agujeros comprobar que los espacios sean adecuados para los botones que se tienen (el largo puede ser un problema con la RaspberryPi que queda justo por debajo).\n\n### Avellanado \n\n![Avellanar 1][countersink1]\n![Avellanar][countersink]\n\n__Antes__ de hacer los agujeros de 5 mm en el acrílico, avellanar cada uno, es importante hacerlo antes ya que quedan mas prolijos que si se hacen con el agujero hecho porque la broca avellanadora rebota y vibra.\n\n![Avellanar 2][countersink2]\n![Avellanar 3][countersink3]\n\nLo importante de este paso es que queden los tornillos insertados en el acrílico y de esa forma no molestan las manos al jugar.\n\n### Armado \n\n![Armado][build1]\n![Armado 2][build2]\n\nLuego de tener hechos todos, pasar primero los botones por el acrílico y luego por la madera (en las fotos ya cubrí la madera con vinilo negro mate), si los agujeros de la madera quedan desalineados con el acrílico una solución simple es agrandar el agujero de la madera ya que luego de poner la hoja con el diseño no se van a ver mas las imperfecciones de la madera.\n\n> Para la hoja con el diseño se puede utilizar una hoja fotográfica de 150 gramos (250 gramos es mas difícil que la impresora la agarre).\n> Los agujeros se pueden hacer con un cutter, no tienen que quedar perfectos ya que los botones tapan esas imperfecciones.\n\n![Armado 3][build3]\n\nPresentar la palanca para tener los agujeros alineados.\n\n![Armado 4][build4]\n\nLos tornillos de la palanca llevan una arandela elástica sobre una arandela plana con la tuerca para que duren mas tiempo si soltarse (se puede usar una contra tuerca también)\n\n![Armado 5][build5]\n\nPor lo general la bola de la palanca se ajusta usando un destornillador desde abajo del vástago teniendo la bola con la mano. Es importante hacerlo para que no se desenrosque la bola mientras se juega.\n\n![Attach][attach1]\n\n### Eles Superiores\n\nUna vez que tenemos la palanca bien ajustada pasamos a terminar las Eles en la caja.\n\n![Attach 2][attach2]\n![Attach 3][attach3]\n![Attach 4][attach4]\n\nInsertamos las tuercas en las 4 Eles de la caja.\n\n![Attach 5][attach5]\n\nInsertamos la tapa en la caja hasta que haga tope con las Eles. Si cuesta que entre, se pueden aflojar los tornillos laterales de las Eles (no sacarlos, solo soltarlos un poco para que la caja tenga un juego en las esquinas).\n\n![Attach 6][attach6]\n\nLuego atornillamos y podemos volver a ajustar los 3 tornillos de cada esquina. No ajustar demasiado porque el acrílico se puede rajar.\n\n> Si al poner uno de estos últimos tornillos no se siente que está enroscando y pasa directo es porque se salio una tuerca, tener cuidado con eso ya que la tuerca va a quedar suelta dentro de la caja y puede dañar la electronica.\n',en:"# TOP\n"},electronics:{es:"[diagram]: /guide/electronics/diagram_es.png\n\n[pcs]: /guide/electronics/pcs.jpg\n\n[build]: /guide/electronics/build.jpg\n[build0]: /guide/electronics/build0.jpg\n[build1]: /guide/electronics/build1.jpg\n[build2]: /guide/electronics/build2.jpg\n[build3]: /guide/electronics/build3.jpg\n\n[rpi1]: /guide/electronics/rpi1.jpg\n[rpi2]: /guide/electronics/rpi2.jpg\n[rpi3]: /guide/electronics/rpi3.jpg\n\n[electronics_spacer_M3]: /guide/electronics/electronics_spacer_M3.stl\n\nLos componentes electrónicos varían según el Modo seleccionado a construir. \nEl objetivo de este paso es mostrar como se conectan entre si.\n\n![Diagrama][diagram]\n\n----\n\nCada componente tiene su pieza en impresión 3D para su exposición fuera de la caja, y para cada pieza realicé una guía específica para su instalación. La excepción es la interfaz USB del joystick, ya que para está va a depender del fabricante la disposición de los orificios para los tornillos. Para ello cree una pieza 3D pequeña para instalar en cualquier lugar de la base usando cualquier medida de la siguiente manera:\n\n![Parts][pcs]\n\nPor cada tornillo (o separador) a utilizar se necesita:\n* 1 pieza 3D [electronics_spacer_M3.stl][electronics_spacer_M3]\n* 1 tuerca M3\n* 1 tornillo M3 x 10 mm\n* 1 tornillo M2.5 x 6 mm\n\n![Build 0][build0]\n\nLa instalación es simplemente marcar y agujerear la base de la caja con las medidas de la interfaz USB a usar.\n\n![Build][build]\n\nLuego se inserta la tuerca M3 y se instala el tornillo M3 desde afuera de la caja hacia adentro y el M2.5 es el que sujeta la electronica a la pieza de plástico (no necesita una tuerca ya que va directo sobre el plástico).\n\n![Build 1][build1]\n![Build 2][build2]\n![Build 3][build3]\n\n> La plantilla descargable posee 6 puntos, 2 para la raspberry pi (en caso de usarla) y 4 para la interfaz USB predeterminada.\n\nA continuación algunas fotos a modo de ejemplo como quedaría con la interfaz y una raspberry pi:\n\n![rpi 1][rpi1]\n![rpi 2][rpi2]\n![rpi 3][rpi3]\n\n",en:"## Electronics\n"},back:{es:'[templates]: /guide/back/templates.png\n[parts]: /guide/back/parts.jpg\n\n[usbb]: /guide/back/usbb.jpg\n[usbb2]: /guide/back/usbb2.jpg\n[usbb3]: /guide/back/usbb3.jpg\n\n[rpi1]: /guide/back/rpi1.jpg\n[rpi2]: /guide/back/rpi2.jpg\n[rpi3]: /guide/back/rpi3.jpg\n[rpi4]: /guide/back/rpi4.jpg\n\n[diagramb]: /guide/back/diagramusb.png\n[conn]: /guide/back/conn.jpg\n\n[backassembly]: /guide/back/backassembly.jpg\n[backassembly1]: /guide/back/backassembly1.jpg\n[backassembly2]: /guide/back/backassembly2.jpg\n[backassembly3]: /guide/back/backassembly3.jpg\n[backassembly4]: /guide/back/backassembly4.jpg\n[backassembly5]: /guide/back/backassembly5.jpg\n\n[rpi_back_w_selector]: /guide/back/rpi_back_w_selector.stl\n[rpi_back]: /guide/back/rpi_back.stl\n[USB_output]: /guide/back/USB_output.stl\n\nLa parte posterior de la caja tiene 3 modos:\n\n![Plantillas][templates]\n\nDe arriba hacia abajo (cada modo posee su pieza 3D):\n1. El Modo Completo con la raspberry pi y un selector USB para la PC [rpi_back_w_selector.stl][rpi_back_w_selector]\n2. Sólo la Raspberry Pi [rpi_back.stl][rpi_back]\n3. El último está pensado para el modo "Solo Joystick" donde no se utiliza una raspberry pi y es solo un puerto de salida USB tipo-B para conectar a la PC [USB_output.stl][USB_output]\n\n> El proyecto está pensado para usar la Raspberry Pi 3 B+, pero debería ser lo mismo para una 2. \n\n### Materiales  \n\n![Partes][parts]\n\nDependiendo del modo elegido serán los componentes a utilizar:\n\nPara todos:\n* 2 Tornillos 5/32" x 12 mm\n* 2 Tuercas __Estampadas__ 5/32" \n* 2 Arandelas Elástica Growler 5/32" \n\nPara el Modulo de USB tipo B (full y solo joystick):\n* 2 Tuercas M3 \n* 2 Tornillos M3 x 6 mm \n\nSi se utiliza una Raspberry Pi:\n* 2 Tornillos M2.5 x 6 mm\n\nPor último, si se utiliza el selector con la Raspberry Pi:\n* Interruptor doble inversora de 6 pines\n* Ficha USB Macho Tipo A\n\n----\n\n### Raspberry Pi\n\n![rpi1][rpi1]\n\n![rpi2][rpi2]\n\nSimplemente insertar la plaqueta en la pieza 3D\n\n![rpi3][rpi3]\n\nLuego poner los tornillos M2.5 (no usar mucha fuerza para no romper el plástico, esos tornillos son sólo para sujetar la plaqueta no necesitan fuerza)\n\n![rpi4][rpi4]\n\n----\n\n### Modulo USB Tipo-B\n\n![usbb][usbb]\n\nPrimero agregar las tuercas M3 por debajo de la pieza (en caso de no entrar se pueden calentar las tuercas con un soldador)\n\n![usbb3][usbb3]\n\nLuego insertar el modulo hasta ver a través de los orificios\n\n![usbb2][usbb2]\n\nAjustar la pieza usando los tornillos M3. \n\n> Si los tornillos M3 son mas largos la pieza no se puede pasar por la abertura del lado posterior (MDF o acrílico), para ese caso, se pueden poner los tornillos luego de insertar la pieza 3D en el MDF.\n\n### Conexiones\n\nEn el caso del modo "Solo Joystick" simplemente se conectan los pines del modulo USB a la interfaz USB del joystick. Esta conexión va a depender de la interfaz usada pero siendo USB es conectar cada correspondiente entre sí (VCC, GND, D+, D-);\n\nPero en el caso del módulo con el selector USB la conexión es un poco mas compleja:\n\n![diagrama][diagramb]\n\nEl resultado final quedaría algo asi:\n\n![conexiones][conn]\n\nLa ficha USB macho va a la raspberry pi, los 4 cables sueltos van a la interfaz USB del joystick y el modulo hembra es para enchufar a la PC. Al cambiar el estado del switch vamos a estar cerrando el circuito entre la interfaz USB y el modulo ó bien entre la interfaz USB y la ficha macho USB (raspberry pi).\n\n---\n\n### Insertando la pieza\n\n![armado][backassembly]\n\nPara agregar la pieza 3D a la parte posterior simplemente presentarla\n\n![armado2][backassembly2]\n![armado3][backassembly3]\n\nAgregar los tornillos desde afuera hacia adentro\n\n![armado4][backassembly4]\n\nLuego agregar la arandela y la tuerca de la misma manera se hizo para la caja\n\n![armado5][backassembly5]\n\n> La pieza puede ser agregada antes o después de armar la caja\n\n',en:"[RPI]\n"},left:{es:'[templates]: /guide/left/templates.png\n[parts]: /guide/left/parts.jpg\n\n[assembly]: /guide/left/assembly.jpg\n[assembly1]: /guide/left/assembly1.jpg\n[assembly2]: /guide/left/assembly2.jpg\n[assembly3]: /guide/left/assembly3.jpg\n[assembly4]: /guide/left/assembly4.jpg\n[assembly5]: /guide/left/assembly5.jpg\n[assembly6]: /guide/left/assembly6.jpg\n\n[ventilation_buttons]: /guide/left/ventilation_buttons.stl\n[ventilation]: /guide/left/ventilation.stl\n[cheat_buttons]: /guide/left/cheat_buttons.stl\n\nLa parte izquierda de la caja tiene 3 modos:\n\n![Plantillas][templates]\n\nDe arriba hacia abajo (cada modo posee su pieza 3D):\n1. Modo de ventilación con cheats [ventilation_buttons.stl][ventilation_buttons]: Cuando se tiene una Raspberry Pi con botones cheats.\n2. Modo sólo ventilación [ventilation.stl][ventilation]: Cuando se tiene una Raspberry Pi sin botones cheats.\n3. Modo sólo cheats [cheat_buttons.stl][cheat_buttons]: Modo sólo joystick con cheats (sin raspberry pi).\n4. Modo sólo joystick sin cheats ni raspberry pi: simplemente no se realiza ninguna abertura.\n\nLos botones cheat están pensados para las interfaces USB que lo soportan de la siguiente manera:\n* [Azul] **Turbo**: selecciona un botón del joystick para que cuando se pulse simule la repetición de pulsaciones (con sólo mantenerlo presionado).\n* [Rojo] **Auto**: selecciona un botón del joystick para que simule automáticamente la pulsación del mismo (sin pulsarlo).\n* [Blanco] **Reinicio**: simplemente desactiva un botón asignado.\n\n### Materiales  \n\n![Partes][parts]\n\nDependiendo del modo elegido serán los componentes a utilizar:\n\nPara todos:\n* 2 Tornillos 5/32" x 12 mm\n* 2 Tuercas __Estampadas__ 5/32" \n* 2 Arandelas Elástica Growler 5/32" \n\nPara los botones cheat:\n* 3 Pulsadores mignon 7mm (normalmente abierto)\n\n---\n\n### Instalando la pieza\n\n![Ensamblado][assembly]\n\nTodas las piezas se instalan de la misma manera, insertando y pasando los 2 tornillos desde afuera hacia adentro.\n\n![Ensamblado 1][assembly1]\n\n![Ensamblado 2][assembly2]\n\nLuego ajustando las arandelas y las tuercas de cada uno.\n\n![Ensamblado 3][assembly3]\n\nEn caso de usar los botones cheat ya se pueden agregar los faston con sus respectivos cables\n\n![Ensamblado 4][assembly4]\n\nPara luego volver a ajustar el lado en la caja con sus respectivas conexiones (en caso de tener botones)\n\n![Ensamblado 5][assembly5]\n\n![Ensamblado 6][assembly6]\n\n> En caso de tener los botones cheat (mignon), se inserta la tuerca desde afuera, el pulsador con su arandela desde adentro hacia afuera y se enrosca.\n',en:""},right:{es:'[init]: /guide/right/init.jpg\n[usb]: /guide/right/usb.png\n[parts]: /guide/right/parts.jpg\n\n[disassemble]: /guide/right/disassemble.jpg\n[disassemble1]: /guide/right/disassemble1.jpg\n[disassemble2]: /guide/right/disassemble2.jpg\n\n[assembly]: /guide/right/assembly.jpg\n[assembly1]: /guide/right/assembly1.jpg\n[assembly2]: /guide/right/assembly2.jpg\n[assembly3]: /guide/right/assembly3.jpg\n[assembly4]: /guide/right/assembly4.jpg\n\n[USB_rack]: /guide/right/USB_rack.stl\n\n![Init][init]\n\nEl lado derecho del joystick esta pensado para el caso de utilizar una raspberry pi y querer exponer los puertos USB de la misma.\n\nEstos puertos se pueden utilizar para conectar otros joysticks o bien un teclado y mouse.\n\n> En caso de no exponer los puertos simplemente no se realiza ninguna abertura.\n\nLa pieza a utilizar esta preparada para un tipo USB switch/hub específico y esto es por su disposición de puertos, calidad y simplicidad. \n\n![USB][usb]\n\nEs un dispositivo genérico por lo que se lo puede encontrar de distintas marcas y colores\n\n### Materiales  \n\n![Partes][parts]\n\nLa pieza 3D es [USB_rack.stl][USB_rack]\n\n* 2 Tornillos 5/32" x 12 mm\n* 2 Tuercas __Estampadas__ 5/32" \n* 2 Arandelas Elástica Growler 5/32" \n* 4 Tornillos auto-perforante 1/8" x 10 mm\n* USB Switch/Rack de 4 puertos\n\n---\n\n### Desarmando el USB switch/hub\n\n![Desarmado][disassemble]\n\nLa caja esta cerrada a presión por lo que abrirlo es cuestión de utilizar algún pequeño destornillador e ir haciendo palanca en los bordes.\n\n![Desarmado 1][disassemble1]\n\nLuego que lo abrimos queda simplemente quitar la plaqueta y poner una cinta aislante negra (o cualquier otra) para tapar el LED.\n\n![Desarmado 2][disassemble2]\n\n> El LED es mejor taparlo ya que prende para marcar que tiene energía y en el joystick va a estar prendido todo el tiempo lo cual se va a notar en la pieza y puede molestar.\n\n---\n\n### Instalando la pieza\n\n![Armado][assembly]\n\nPrimero insertar la pieza 3D ya que la plaqueta es mayor a la abertura hecha.\n\n![Armado 1][assembly1]\n\nInsertar los tornillos desde afuera y agregar las arandelas y luego las tuercas.\n\n![Armado 2][assembly2]\n\nLuego poner la plaqueta con sus 4 tornillos. \n\n![Armado 3][assembly3]\n\nFinalmente enchufar el USB de la plaqueta a la Raspberry Pi.\n\n![Armado 4][assembly4]\n',en:""},front:{es:"[init]: /guide/front/init.jpg\n[parts]: /guide/front/parts.jpg\n[diagram]: /guide/front/diagrampi.png\n\n[cables]: /guide/front/cables.jpg\n[cables1]: /guide/front/cables1.jpg\n[cables2]: /guide/front/cables2.jpg\n\n[assembly]: /guide/front/assembly.jpg\n[assembly1]: /guide/front/assembly1.jpg\n[assembly2]: /guide/front/assembly2.jpg\n[assembly3]: /guide/front/assembly3.jpg\n[assemblypi]: /guide/front/assemblypi.jpg\n\n![Init][init]\n\nEl frente del joystick posee 2 botones (start y select) y un botón opcional de encendido para la Raspberry Pi.\n\nLos botones de start y select son simplemente insertarlos y enchufarlos en la interfaz USB elegida. Me voy a concentrar en como armar el botón de encendido que es la parte compleja.\n\n### Materiales  \n\n![Cables][cables]\n\n* Pulsador Momentáneo (normalmente abierto) con ó sin LED\n* 4 cables Dupont Hembra-Hembra x 200 mm de largo \n* 4 terminales Faston Hembra 2.8 mm (opcional, se puede soldar directamente al pulsador)\n\n---\n\n### Diagrama de conexion\n\nGlosario:\n\n* `COM` común\n* `NA` / `NO` normalmente abierto\n* `NC` normalmente cerrado\n* `LED+` positivo del led\n* `LED-` negativo del led\n* `GND` ground / negativo\n* `Pin No.` Número de Pin\n\nDependiendo del pulsador tenemos al menos 2 pines (COM y NA), en otros podemos tenemos un pin mas de NC (sin uso) y en el caso de que tenga un LED tendremos 2 pin mas LED+ y LED-\n\n![Diagrama][diagram]\n\n---\n\n### Armando los cables\n\nPara los cables Dupont recomiendo utilizar colores para no hacer mal las conexiones, **conectar mal en la RaspberryPi puede significar quemarla**\n\nLo ideal es tener 2 cables del mismo color para el negativo (negro preferible) y otros 2 cables de distinto color para identificar el positivo del led y el NA del pulsador.\n\n![Cables 1][cables1]\n\nCortamos los extremos de cada uno.\n\n![Cables 2][cables2]\n\nAgregamos los terminales Faston a cada uno.\n\n---\n\n### Insertando los botones\n\n![Armado][assembly]\n\nUna vez que tenemos los cables armados, insertamos los botones en sus respectivos agujeros.\n\n![Armado 1][assembly1]\n![Armado 2][assembly2]\n\nLuego ponemos los cables (ver diagrama). En algunos pulsadores se puede ver cual es cual, en otros es cuestión de probar con un multímetro se puede ver cual es el NA y el COM. Para el caso del LED no se va a quemar por ponerlo al revés y en algunos casos funciona sin importar su sentido ya que están preparados para recibir voltage alterno.\n\n![Armado 3][assembly3]\n\nLuego conectamos los terminales de los cables a sus respectivos lugares, los botones del joystick van a la interfaz USB y los del pulsador de encendido a la RaspberryPi según diagrama.\n\n![Armado PI][assemblypi]\n\n> Comprobar 2 veces las conexiones, una mala conexión puede destruir la RaspberryPi.\n\n---\n\n### Configurado la RaspberryPi\n\nPara que el botón de encendido funcione necesitamos hacer unos cambios en el sistema de la raspberry pi (raspbian).\n\n[TODO]\n\n",en:""}}};
